import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import notes from "../notes";

function createNote(note){
    return <Note 
        key = {notes.key}
        title = {notes.title}
        content = {notes.title}
    />
}

function  App(){
    return (<div>
        <Header />
        {notes.map()}
        <Footer />
        </div>);
}

export default App;
